import { LOAD_DATA, FILTER_DATA } from "../actions/constants";

const initialState = {
  data: [],
  isLoading: true,
};

const trsReducer = (state = initialState, action) => {
  const { type, payload } = action;
  switch (type) {
    case LOAD_DATA:
      return { ...state, data: payload, isLoading: false };
    default:
      return state;
  }
};

export default trsReducer;
